import React, { useState, DragEvent, ChangeEvent } from "react";
import { Upload, FileText, ArrowLeft, Activity, Shield, Zap, Sparkles, CheckCircle2, Loader2, Database } from "lucide-react";
import { useNavigate } from "react-router-dom";
import { fileService } from "../../services/fileService";
import { motion, AnimatePresence } from "framer-motion";

const UploadFilePage: React.FC = () => {
  const navigate = useNavigate();
  const [dragActive, setDragActive] = useState(false);
  const [fileName, setFileName] = useState<string | null>(null);
  const [file, setFile] = useState<File | null>(null);
  const [title, setTitle] = useState("");
  const [description, setDescription] = useState("");
  const [uploading, setUploading] = useState(false);

  const handleDrag = (e: DragEvent<HTMLDivElement>) => {
    e.preventDefault();
    e.stopPropagation();
    if (e.type === "dragenter" || e.type === "dragover") {
      setDragActive(true);
    } else if (e.type === "dragleave") {
      setDragActive(false);
    }
  };

  const handleDrop = (e: DragEvent<HTMLDivElement>) => {
    e.preventDefault();
    e.stopPropagation();
    setDragActive(false);
    if (e.dataTransfer.files && e.dataTransfer.files[0]) {
      setFile(e.dataTransfer.files[0]);
      setFileName(e.dataTransfer.files[0].name);
    }
  };

  const handleFileChange = (e: ChangeEvent<HTMLInputElement>) => {
    if (e.target.files && e.target.files[0]) {
      setFile(e.target.files[0]);
      setFileName(e.target.files[0].name);
    }
  };

  const handleSubmit = async () => {
    if (!file || !title) return;
    setUploading(true);
    try {
      await fileService.uploadFile(file, title, description);
      navigate("/files");
    } catch (error) {
      console.error("Upload failed", error);
    } finally {
      setUploading(false);
    }
  };

  return (
    <div className="min-h-screen bg-[#fcfdfe] text-slate-900 font-sans">
      <div className="max-w-[800px] mx-auto px-6 py-10 lg:py-12 relative z-10">

        {/* Header */}
        <div className="flex items-center justify-between mb-12">
          <button
            onClick={() => navigate("/files")}
            className="flex items-center gap-2 text-slate-400 hover:text-slate-900 font-bold transition-all text-sm"
          >
            <ArrowLeft size={20} />
            Back to Repository
          </button>
          <div className="flex items-center gap-2 px-4 py-1.5 bg-indigo-50 text-indigo-600 rounded-full text-[11px] font-bold uppercase tracking-wider border border-indigo-100 shadow-sm">
            <Database size={14} />
            Asset Injection Protocol
          </div>
        </div>

        <div className="grid grid-cols-1 lg:grid-cols-12 gap-12 items-start">
          {/* Left: Info */}
          <div className="lg:col-span-4 space-y-8">
            <div>
              <h1 className="text-4xl font-bold tracking-tight text-slate-900 mb-2">
                Data <br />
                <span className="text-indigo-600">Upload.</span>
              </h1>
              <p className="text-slate-500 font-medium leading-relaxed italic">
                "Securely transmit mission-critical assets into the encrypted workspace vault."
              </p>
            </div>

            <div className="space-y-4 pt-6">
              <div className="flex items-start gap-4 p-5 bg-white rounded-2xl border border-slate-100 shadow-sm">
                <div className="p-2 bg-indigo-50 text-indigo-600 rounded-lg shrink-0"><Zap size={16} /></div>
                <div>
                  <p className="text-xs font-bold text-slate-900 mb-0.5">High Speed</p>
                  <p className="text-[11px] font-medium text-slate-400 leading-tight">Optimized cloud delivery sequence.</p>
                </div>
              </div>
              <div className="flex items-start gap-4 p-5 bg-white rounded-2xl border border-slate-100 shadow-sm">
                <div className="p-2 bg-emerald-50 text-emerald-600 rounded-lg shrink-0"><Shield size={16} /></div>
                <div>
                  <p className="text-xs font-bold text-slate-900 mb-0.5">Encrypted</p>
                  <p className="text-[11px] font-medium text-slate-400 leading-tight">End-to-end operational security.</p>
                </div>
              </div>
            </div>
          </div>

          {/* Right: Dropzone & Form */}
          <div className="lg:col-span-8">
            <div className="bg-white rounded-[32px] border border-slate-100 p-10 shadow-sm">
              {/* Drag & Drop Zone */}
              <div
                className={`relative border-2 border-dashed rounded-3xl p-12 text-center transition-all group overflow-hidden mb-8 ${dragActive ? "border-indigo-500 bg-indigo-50/30" : "border-slate-100 bg-slate-50/50 hover:border-indigo-200"
                  }`}
                onDragEnter={handleDrag}
                onDragOver={handleDrag}
                onDragLeave={handleDrag}
                onDrop={handleDrop}
              >
                <div className={`w-16 h-16 rounded-2xl flex items-center justify-center mx-auto mb-6 transition-all ${fileName ? 'bg-indigo-600 text-white shadow-lg' : 'bg-white text-indigo-500 shadow-sm group-hover:scale-110'
                  }`}>
                  <Upload size={24} />
                </div>

                <h3 className="text-lg font-bold text-slate-900 mb-1">
                  {fileName ? "Asset Synchronized" : "Manifest Data Drop"}
                </h3>
                <p className="text-xs font-medium text-slate-400 max-w-xs mx-auto mb-6">
                  {fileName ? fileName : "Drag and drop your files or browse the local repository."}
                </p>

                {!fileName && (
                  <div>
                    <label
                      htmlFor="fileUpload"
                      className="px-6 py-2.5 bg-white border border-slate-200 text-slate-600 rounded-xl text-xs font-bold hover:border-indigo-500 hover:text-indigo-600 cursor-pointer shadow-sm transition-all inline-flex items-center"
                    >
                      Browse Folder
                    </label>
                    <input id="fileUpload" type="file" className="hidden" onChange={handleFileChange} />
                  </div>
                )}
              </div>

              {/* Metadata Section */}
              <div className="space-y-6">
                <div className="space-y-2">
                  <label className="text-[11px] font-bold text-slate-400 uppercase tracking-wider ml-1">Asset Identifier</label>
                  <input
                    type="text"
                    placeholder="e.g. Q4 Performance Analysis"
                    value={title}
                    onChange={(e) => setTitle(e.target.value)}
                    className="w-full px-5 py-3.5 bg-slate-50 border border-slate-100 rounded-2xl text-slate-900 font-semibold text-sm focus:bg-white focus:border-indigo-500 outline-none transition-all placeholder:text-slate-300"
                  />
                </div>

                <div className="space-y-2">
                  <label className="text-[11px] font-bold text-slate-400 uppercase tracking-widest ml-1">Context Briefing</label>
                  <textarea
                    placeholder="Enter additional tactical briefing data..."
                    value={description}
                    onChange={(e) => setDescription(e.target.value)}
                    rows={4}
                    className="w-full px-5 py-3.5 bg-slate-50 border border-slate-100 rounded-2x text-slate-900 font-semibold text-sm focus:bg-white focus:border-indigo-500 outline-none transition-all placeholder:text-slate-300 resize-none"
                  />
                </div>

                <div className="pt-6 flex items-center justify-end gap-8 border-t border-slate-50">
                  <button
                    onClick={() => navigate("/files")}
                    className="text-xs font-bold text-slate-400 hover:text-slate-600 transition-colors uppercase tracking-widest"
                  >
                    Abort
                  </button>
                  <button
                    onClick={handleSubmit}
                    disabled={!fileName || !title || uploading}
                    className="flex items-center gap-2 px-8 py-3.5 bg-indigo-600 hover:bg-indigo-700 text-white rounded-2xl font-bold text-sm shadow-xl shadow-indigo-100 transition-all flex items-center gap-2 disabled:opacity-20 disabled:cursor-not-allowed"
                  >
                    {uploading ? <Loader2 size={18} className="animate-spin" /> : <CheckCircle2 size={18} />}
                    Establish Uplink
                  </button>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default UploadFilePage;
